// SPDX-License-Identifier: <SPDX-License>
pragma solidity ^0.8.2;

import './Doge.sol';
import './Elon.sol';
import './TokenLP1.sol';

contract ElonDogeLP{
    address public owner;
    Doge public dogeToken;
    Elon public elonToken;
    TokenLP1 public elonDogeToken;
    address[] public stakers;
    mapping(address => uint) public stakingBalance;
    mapping(address => bool) public hasStaked;
    mapping(address => bool) public isStaking;
    constructor (Doge _dogeToken, Elon _elonToken, TokenLP1 _elonDogeToken){
        dogeToken = _dogeToken;
        elonToken = _elonToken;
        elonDogeToken = _elonDogeToken;
        owner = msg.sender;
    }
    
    function stakeTokens(uint _amount) public {
        require(_amount > 0, "amount cannot be 0");
        dogeToken.transferFrom(msg.sender, address(this), _amount);
        elonToken.transferFrom(msg.sender, address(this), _amount);
        elonDogeToken.transfer(msg.sender, _amount);
        stakingBalance[msg.sender] = stakingBalance[msg.sender] + _amount;
        if(!hasStaked[msg.sender]) {
            stakers.push(msg.sender);
        }
        isStaking[msg.sender] = true;
        hasStaked[msg.sender] = true;
    }

    function unstakeTokens() public {
        uint balance = stakingBalance[msg.sender];
        require(balance > 0, "staking balance cannot be 0");
        dogeToken.transfer(msg.sender, balance);
        elonToken.transfer(msg.sender, balance);
        elonDogeToken.transferFrom(msg.sender, address(this), balance);
        stakingBalance[msg.sender] = 0;
        isStaking[msg.sender] = false;
    }
}
